import React, { Component } from 'react';
import Customer from './Components/Customer'
import './App.css';

const customers = [
  {
    name:"Brandon",
    id:"1",
    gender:"male",
    birthday:"881107",
    job:"Student",
  },
  {
    name:"Steve",
    id:"2",
    gender:"male",
    birthday:"860117",
    job:"Programmer",
  },
  {
    name:"Suzanne",
    id:"3",
    gender:"female",
    birthday:"931028",
    job:"Designer",
  },

]

class App extends Component {
  render () {
    return (
      <>
        <div>
          {customers.map(customer => (<Customer key={customer.id} name={customer.name} />))}
        </div>
      </>
    );
  }
}

export default App;
